import React, {useState, useEffect} from "react"
import service from "./services.js"

const DisplayEntry = ({ lat, lng, name, id }) => {
    const [ newName, setName ] = useState(name)
    const [ newLat, setLat] = useState(lat)
    const [ newLng, setLng] = useState(lng)
  //  const [ newNumber, setNumber ] = useState(number)
    const [ buttonVal, setButtonVal ] = useState("")

    const deleteHandler = (id) =>{
        const handler = () =>{
            if(window.confirm(`Do you reall want to delete ${name}\'s number?`)){
                service.deletion(id)
                .then(response => {

                    setName("")
                    setLat("")
                    setLng("")

                    setButtonVal("")
                })
            }
        }
        return handler
    }

    useEffect(()=>{
        setButtonVal(<button onClick={deleteHandler(id)}>delete</button>)
    },
    [])

    return(
        <div>

            {newName} 
            {newLat} 
            {newLng} {buttonVal}

        </div>
    )
}

const DisplayEntries = ({ names,lats,lngs, regVal }) => {
    const regExp = new RegExp(regVal, "i")
    const filteredArray = names.filter((entry) => regExp.test(entry.name))
    const filteredArray1 = lats.filter((entry) => regExp.test(entry.lat))
    const filteredArray2 = lngs.filter((entry) => regExp.test(entry.lng))


    const namesArray = filteredArray.map((entry) => <DisplayEntry key={entry.id} name={entry.name} id={entry.id} />)
    const latsArray = filteredArray1.map((entry) => <DisplayEntry key={entry.id} name={entry.lat} id={entry.id} />)
    const lngsArray = filteredArray2.map((entry) => <DisplayEntry key={entry.id} name={entry.lng} id={entry.id} />)

    return(
    <div>
        {namesArray}
        {latsArray}
        {lngsArray}
    </div>
    )
}

export default DisplayEntries
